import React from "react";
import '../components/component.css'

const Addnewvehicle = (props) => {
  const modal=props.toggle

  return (
    <div className={`${modal ? active:''}`}>
      <div>
        <label>Toll Name</label>
        
      </div>
    </div>
  );
};

export default Addnewvehicle;
